    title: string;
    lineColor: string;
    controllers: React.ReactNode;
}


const ContentHeader: React.FC<IContentHeaderProps> = ({
    title, lineColor,controllers
}) => {


    const options = [
        {value: 'rafa', label: 'rafa'},
        {value: 'charlie', label: 'charlie',}
    ];

    return (
        <Container>
            <TitleContainer>
                <h1>Title</h1>
            </TitleContainer>

            <Controllers>
                { controllers }
               
             </Controllers>
        </Container>
        
    );
}

export default ContentHeader;
